# Find the local minimum of $f(x) = (x-3)^4$

# In[ ]:


import matplotlib.pyplot as plt
import numpy as np

def f(x):
    return (x-2)**3
print(f(5))

def derf(x):
    return 4*(x-3)
i=5
w=0.05 
x=i

def gradient_descent(x,weight):
    return x-weight*derf(x)

X=np.arange(2,10,0.4)
Y=[f(i) for i in X]

X1=[]
y1=[]

for i in range(5):
    X1.append(x)
    y1.append(f(x))
    x=gradient_descent(x,w)
   
plt.plot(X,Y)
plt.scatter(X1,y1,marker="+",color="black")
plt.show()


